import {BrowserRouter, Routes, Route} from "react-router-dom";
import { useState } from "react";
import Show from './components/Show'

const App = () =>{
  const [dog, setDog] = useState([])

  return(
    <div>
      <>
        <BrowserRouter>
          <Layout>
            <Routes>
              <Route path='/' element={<Show dog={dog} setDog={setDog}/>}></Route>

            </Routes>
          </Layout>
        </BrowserRouter>
      </>
    </div>
  )
}

export default App
